import React from 'react';
import RightTable from '../../components/right-table/right-table.component';
import SalesTable from '../../components/sales-table/sales-table.container';

import './sales-record-styles.scss';

const SalesRecord = () => {
	return (
		<div className='sales-record-container'>
			<div className='sales-heading'>
				<p>Oder Details</p>
			</div>
			<div className='upper-section'>
				<SalesTable />
				<RightTable />
			</div>
			<div className='lower-section'>
				<div className='sale-panel'>
					<div className=''>
						<label htmlFor=''>Product Id:</label>
						<input className='oder-form' placeholder='Product Id' />
					</div>
					<div className=''>
						<label htmlFor=''>Product Id:</label>
						<input className='oder-form' placeholder='Product Id' />
					</div>
					<div className=''>
						<label htmlFor=''>Product Id:</label>
						<input className='oder-form' placeholder='Product Id' />
					</div>

					<span>Value</span>
					<div className='bt'>
						<button>Submit</button>
					</div>
				</div>
			</div>
		</div>
	);
};

export default SalesRecord;
